import React, { useEffect, useRef } from 'react';
import Svg, { Line, Defs, Pattern, Rect } from 'react-native-svg';
import { View, StyleSheet, Animated, Easing } from 'react-native';

const GridBackground = () => {
  const fadeAnim = useRef(new Animated.Value(0.3)).current;
  const translateAnim = useRef(new Animated.Value(0)).current;
  const fadeAnim2 = useRef(new Animated.Value(0.2)).current;

  useEffect(() => {
    // Primary breathing animation - slower and smoother
    const breathingAnimation = Animated.sequence([
      Animated.timing(fadeAnim, {
        toValue: 0.5,
        duration: 4000,
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      }),
      Animated.timing(fadeAnim, {
        toValue: 0.3,
        duration: 4000,
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      })
    ]);

    // Secondary breathing animation - even slower for depth
    const breathingAnimation2 = Animated.sequence([
      Animated.timing(fadeAnim2, {
        toValue: 0.4,
        duration: 6000,
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      }),
      Animated.timing(fadeAnim2, {
        toValue: 0.2,
        duration: 6000,
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      })
    ]);

    // Smoother movement animation
    const movementAnimation = Animated.sequence([
      Animated.timing(translateAnim, {
        toValue: 30,  // Reduced movement range
        duration: 8000,  // Slower movement
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      }),
      Animated.timing(translateAnim, {
        toValue: 0,
        duration: 8000,
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      })
    ]);

    // Start all animations in loop
    Animated.loop(breathingAnimation, { iterations: -1 }).start();
    Animated.loop(breathingAnimation2, { iterations: -1 }).start();
    Animated.loop(movementAnimation, { iterations: -1 }).start();
  }, []);

  return (
    <View style={styles.container}>
      {/* Base layer - larger grid */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim2,
            transform: [{ translateX: Animated.multiply(translateAnim, -0.3) }]  // More subtle movement
          }
        ]}
      >
        <Svg height="100%" width="100%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid3" 
              width="200"  // Larger pattern
              height="200" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(30)"
            >
              <Line
                x1="0"
                y1="200"
                x2="200"
                y2="200"
                stroke="#400000"  // Darker, more subtle color
                strokeWidth="0.8"
              />
              <Line
                x1="200"
                y1="0"
                x2="200"
                y2="200"
                stroke="#400000"
                strokeWidth="0.8"
              />
            </Pattern>
          </Defs>
          <Rect width="150%" height="150%" fill="url(#grid3)" x="-25%" y="-25%" />
        </Svg>
      </Animated.View>

      {/* Middle layer */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [{ translateX: translateAnim }]
          }
        ]}
      >
        <Svg height="100%" width="100%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid" 
              width="75" 
              height="75" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(45)"
            >
              <Line
                x1="0"
                y1="75"
                x2="75"
                y2="75"
                stroke="#600000"
                strokeWidth="0.4"
              />
              <Line
                x1="75"
                y1="0"
                x2="75"
                y2="75"
                stroke="#600000"
                strokeWidth="0.4"
              />
            </Pattern>
          </Defs>
          <Rect width="130%" height="130%" fill="url(#grid)" x="-15%" y="-15%" />
        </Svg>
      </Animated.View>

      {/* Top layer - finest grid */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim2,
            transform: [{ translateX: Animated.multiply(translateAnim, -0.7) }]
          }
        ]}
      >
        <Svg height="100%" width="100%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid2" 
              width="30" 
              height="30" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(-45)"
            >
              <Line
                x1="0"
                y1="30"
                x2="30"
                y2="30"
                stroke="#300000"
                strokeWidth="0.2"
              />
              <Line
                x1="30"
                y1="0"
                x2="30"
                y2="30"
                stroke="#300000"
                strokeWidth="0.2"
              />
            </Pattern>
          </Defs>
          <Rect width="150%" height="150%" fill="url(#grid2)" x="-25%" y="-25%" />
        </Svg>
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
    overflow: 'hidden',
  },
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
  },
  grid: {
    position: 'absolute',
    top: 0,
    left: 0,
  },
});

export default GridBackground;
